    false,nt"url": null,nt"notes": "This narrative report for Talcot Lake NWR
    outlines Refuge accomplishments from May through August of 1945. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, furbearers, and raptors- is also covered.
    The Refuge development and maintenance section discusses plantings. Resource management
    is outlined; topics include grazing. The public relations section of the report
    describes Refuge visitors and fishing. N-R forms are attached.",nt"license_title":
